DECLARE @BuildNumber VARCHAR(1000)
DECLARE @BuildType CHAR(1)
DECLARE @Comments VARCHAR(MAX)
DECLARE @SmartCareReleaseId INT

DECLARE @ReleaseNoteName VARCHAR(1000)
DECLARE @ReleaseNoteType VARCHAR(1000)
DECLARE @ReleaseNoteData VARCHAR(MAX)
DECLARE @ReleaseNoteDataText VARCHAR(MAX)
DECLARE @ReleaseNoteFileId VARCHAR(MAX)


SET @BuildNumber = NULL
SET @BuildType = NULL
SET @Comments = NULL
SET @SmartCareReleaseId = NULL

SET @BuildNumber = 'SEKMHC.BASE.6.0_0.03.000.2506.001'
SET @BuildType = 'S'
SET @Comments = 'June 2025 Custom Build for SmartCare 6.0  - SEKMHC.BASE.6.0_0.03.000.2506.001'

IF NOT EXISTS (SELECT 1 FROM SmartCareReleases WHERE BuildNumber = @BuildNumber AND ISNULL(RecordDeleted, 'N') = 'N') AND ISNULL(@BuildNumber, '') <> ''
BEGIN
    INSERT INTO [SmartCareReleases]([CreatedBy],[CreatedDate],[ModifiedBy],[ModifiedDate],[BuildType],[BuildNumber],[Comments],[ReleaseNoteFileId])
    VALUES (SYSTEM_USER,GETDATE(),SYSTEM_USER,GETDATE(),@BuildType,@BuildNumber,@Comments,@ReleaseNoteFileId)

    SET @SmartCareReleaseId = @@IDENTITY

END
ELSE
BEGIN
    SELECT TOP 1 @SmartCareReleaseId = SmartCareReleaseId FROM SmartCareReleases WHERE BuildNumber = @BuildNumber AND ISNULL(RecordDeleted, 'N') = 'N' AND ISNULL(@BuildNumber, '') <> ''
END


